import React, {useState, useEffect} from "react";
import './Home.css';
import {Header, Table, Icon} from "semantic-ui-react";
import {BACKEND} from "../config";
import axios from 'axios';
import _ from 'lodash';

const Home = () => {
  const [data, setData] = useState([]);
  const [rows, setRows] = useState([]);
  useEffect(() => {
    axios.get(`${BACKEND}/get_data`)
      .then(response=>{
        // console.log(response.data)
        let temp_rows = response.data.map(row => {
          console.log(row)
          return (
            <Table.Row>
              <Table.Cell>{row['Order ID']}</Table.Cell>
              <Table.Cell>{row['Region']}</Table.Cell>
              <Table.Cell>{row['Country']}</Table.Cell>
              <Table.Cell>{row['Item Type']}</Table.Cell>
              <Table.Cell>{row['Sales Channel']}</Table.Cell>
              <Table.Cell>{row['Order Priority']}</Table.Cell>
              <Table.Cell>{row['Order Date']}</Table.Cell>
              <Table.Cell>{row['Order ID']}</Table.Cell>
              <Table.Cell>{row['Ship Date']}</Table.Cell>
              <Table.Cell>{row['Units Sold']}</Table.Cell>
              <Table.Cell>{row['Unit Price']}</Table.Cell>
              <Table.Cell>{row['Unit Cost']}</Table.Cell>
              <Table.Cell>{row['Total Revenue']}</Table.Cell>
              <Table.Cell>{row['Total Cost']}</Table.Cell>
              <Table.Cell>{row['Total Profit']}</Table.Cell>
            </Table.Row>
          )
        });
        setRows(temp_rows);
        // setData(response.data)
      })
      .catch(err=>{
        console.log(err);
      })
  }, [data]);

  // useEffect(() => {
  //
  // }, [data]);

  return (
    <div className="container">
      <div className="header">
        <Header as='h2'>
          <Icon name='settings' />
          <Header.Content>
            Reports
          </Header.Content>
        </Header>
      </div>
      <div className="table">
        <Table unstackable>
          <Table.Header>
            <Table.Row>
              <Table.HeaderCell>Order ID</Table.HeaderCell>
              <Table.HeaderCell>Region</Table.HeaderCell>
              <Table.HeaderCell>Country</Table.HeaderCell>
              <Table.HeaderCell>Item Type</Table.HeaderCell>
              <Table.HeaderCell>Sales Channel</Table.HeaderCell>
              <Table.HeaderCell>Order Priority</Table.HeaderCell>
              <Table.HeaderCell>Order Date</Table.HeaderCell>
              <Table.HeaderCell>Order ID</Table.HeaderCell>
              <Table.HeaderCell>Ship Data</Table.HeaderCell>
              <Table.HeaderCell>Units Sold</Table.HeaderCell>
              <Table.HeaderCell>Unit Price</Table.HeaderCell>
              <Table.HeaderCell>Unit Cost</Table.HeaderCell>
              <Table.HeaderCell>Total Revenue</Table.HeaderCell>
              <Table.HeaderCell>Total Cost</Table.HeaderCell>
              <Table.HeaderCell>Total Profit</Table.HeaderCell>
            </Table.Row>
          </Table.Header>
          <Table.Body>
            {rows.length>0?rows:<div className="no_data"><h5>No Data</h5></div>}
          </Table.Body>
        </Table>
      </div>
    </div>
  );
}

export default Home;
